logBox$CaptionImpl',dxc='DialogBox$MouseHandler',fqc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",SAc='Dimension',jmc='Dimension [height=',fxc='DirectionalTextHelper',ixc='DockLayoutPanel',jxc='DockLayoutPanel$Direction',kxc='DockLayoutPanel$Direction;',nxc='DockLayoutPanel$DockAnimateCommand',lxc='DockLayoutPanel$LayoutData',otc='DomEvent',ttc='DomEvent$Type',Azc='Double',ijc='EAST',Qdc='EEE, d MMM yyyy HH:mm:ss Z',bpc='EEE. dd MMM. yyyy HH:mm:ss',Qec='EEEE MMMM d',pfc='EEEE, MMMM d',lfc='EEEE, MMMM d, y',Mec='EEEE, y MMMM dd',rbc='EM',khc='EMPTY',phc='ENABLED',Jfc='END',tbc='EX',Kvc='ElementMapperImpl',Lvc='ElementMapperImpl$FreeNode',kfc='English',Asc='Enum',bfc='Etc/GMT',dfc='Etc/GMT+',cfc='Etc/GMT-',Mbc='Event type',Gyc='Event$NativePreviewEvent',Gtc='EventBus',Nrc='EventObject',Src='Exception',Nhc='Expecting version 6 from server, got ',Hcc='F',knc='F8834F07517EF3B7D02B9E845E5E1B88',mbc='FIXED',jic='FLOAT',Rmc='Fail: ',_cc='Feb',Pcc='February',Gqc='Female',Bzc='Float',oxc='FlowPanel',Dwc='FocusImpl',Fwc='FocusImplSafari',Ewc='FocusImplStandard',Owc='FocusWidget',llc='For input string: "',Ddc='Fri',wdc='Friday',$bc='GET',spc='GGD55XLBAH',crc='GGD55XLBAJ',pqc='GGD55XLBBI',rpc='GGD55XLBCH',rqc='GGD55XLBCI',Ngc='GGD55XLBDB',qpc='GGD55XLBDH',lrc='GGD55XLBDJ',$pc='GGD55XLBDK',Agc='GGD55XLBEB',opc='GGD55XLBEH',qqc='GGD55XLBEI',drc='GGD55XLBEJ',Ogc='GGD55XLBFB',vpc='GGD55XLBFH',Oqc='GGD55XLBFI',Erc='GGD55XLBFK',Lqc='GGD55XLBGI',Crc='GGD55XLBGK',Rgc='GGD55XLBHB',Dpc='GGD55XLBHH',zqc='GGD55XLBHI',Brc='GGD55XLBHK',Fpc='GGD55XLBIH',yrc='GGD55XLBIK',Epc='GGD55XLBJH',Aoc='GGD55XLBJJ',Drc='GGD55XLBJK',Qpc='GGD55XLBKG',kqc='GGD55XLBKH',Pqc='GGD55XLBKI',trc='GGD55XLBKK',Npc='GGD55XLBLG',jqc='GGD55XLBLH',Hqc='GGD55XLBLI',urc='GGD55XLBLK',Upc='GGD55XLBMG',iqc='GGD55XLBMH',Eoc='GGD55XLBMJ',Spc='GGD55
